import com.eviware.soapui.support.XmlHolder

def holder = new XmlHolder( messageExchange.responseContentAsXml)
def addressid = holder.getNodeValue("//addresses/item/id")
log.info(addressid)
//Storing the addressid in addressid 
context.testCase.setPropertyValue("addressid", addressid)

import com.eviware.soapui.support.GroovyUtils
def gUtil = new GroovyUtils(context)

// import the Request property

def deleteReqXml = context.expand('${DeleteAddress#Request}')

// create an xml holder to get ADD result value
def Xmlhol = gUtil.getXmlHolder(deleteReqXml)

def deleteResXml  = context.expand('${DeleteAddress#Response}')

def holder = gUtil.getXmlHolder(deleteResXml)

def expect = holder.getNodeValue("//*:result")
log.info(expect)

def actual  =  "true"

assert actual == expect

con:config.script:
import com.eviware.soapui.model.testsuite.TestRunner.Status

//Get Testcase
def tc = testRunner.testCase.testSuite.project.testSuites["AssignmentFunctional"].testCases["CustomerAddress"]

//Run test synchronously
def runner = tc.run(null, false)

//Show the test case run result status
log.info "Status: $runner.status, time taken for TestCase was: $runner.timeTaken ms"
log.info "Number of test steps that run: " + runner.results.size()

//Assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

//Assert that only 3 steps run
assert runner.results.size() == 3
